import React from "react";
import { Link } from "react-router-dom";
import { Menu } from "../Menu/Menu";
import { PreHeader } from "../PreHeader/PreHeader";

export const Header = ({ isMenuOpened, handleMenuClick, language, setLanguage, handleLanguageChange }) => (
    <div className="header">
        <PreHeader {...{ language, setLanguage, handleLanguageChange }} />
        <Link to="/" className="logo-link">
            <img className="bnb-logo-img" alt="bnb Favignana Logo" src={process.env.PUBLIC_URL + '/images/logo/bnb-logo.png'} />
        </Link>
        <h1 className="place-name">B&B Favignana</h1>
        <Menu {...{ isMenuOpened, handleMenuClick, language }} />
    </div>
);
